      i0.ɵɵelementStart(117, "p", 54);
      i0.ɵɵtext(118, " \u0418\u043D\u043E\u0433\u0434\u0430 \u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442\u0441\u044F, \u0447\u0442\u043E \u0432\u044B\u0431\u043E\u0440 \u043D\u0430\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u044F \u043F\u0440\u0438 \u043F\u043E\u0441\u0442\u0443\u043F\u043B\u0435\u043D\u0438\u0438 \u0432\u00A0\u0432\u0443\u0437 \u0431\u044B\u043B \u043E\u0448\u0438\u0431\u043E\u0447\u043D\u044B\u043C. ");
      i0.ɵɵelementStart(119, "strong");
      i0.ɵɵtext(120, "\u0418\u0440\u0438\u043D\u0430 \u0422\u0438\u0442\u043A\u043E\u0432\u0430");
      i0.ɵɵelementEnd();
      i0.ɵɵtext(121, " \u0441\u0447\u0438\u0442\u0430\u0435\u0442, \u0447\u0442\u043E \u00AB\u043F\u043E\u043D\u044F\u0442\u044C, \u0447\u0435\u0433\u043E \u0442\u044B\u00A0\u0445\u043E\u0447\u0435\u0448\u044C, \u0432\u00A0\u0432\u0443\u0437\u0435 \u043D\u0435\u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E. \u0412\u00A0\u0441\u0435\u043C\u043D\u0430\u0434\u0446\u0430\u0442\u044C \u043B\u0435\u0442 \u043F\u043E\u043D\u044F\u0442\u044C \u044D\u0442\u043E\u0433\u043E \u043D\u0435\u043B\u044C\u0437\u044F, \u0438\u00A0\u0432\u00A0\u0432\u043E\u0441\u0435\u043C\u043D\u0430\u0434\u0446\u0430\u0442\u044C \u043D\u0435\u043B\u044C\u0437\u044F. \u0422\u043E, \u0447\u0442\u043E \u0432\u00A0\u043D\u0435\u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u0441\u0442\u0440\u0430\u043D\u0430\u0445 \u0441\u043E\u0432\u0435\u0440\u0448\u0435\u043D\u043D\u043E\u043B\u0435\u0442\u0438\u0435 \u043D\u0430\u0441\u0442\u0443\u043F\u0430\u0435\u0442 \u0432\u00A0\u0434\u0432\u0430\u0434\u0446\u0430\u0442\u044C \u043E\u0434\u0438\u043D \u0433\u043E\u0434, \u0441\u043E\u0432\u0435\u0440\u0448\u0435\u043D\u043D\u043E \u043F\u0440\u0430\u0432\u0438\u043B\u044C\u043D\u043E. \u0412\u043E\u0442 \u0442\u043E\u043B\u044C\u043A\u043E \u0442\u043E\u0433\u0434\u0430 \u0447\u0435\u043B\u043E\u0432\u0435\u043A \u043C\u043E\u0436\u0435\u0442 \u043D\u0430\u0447\u0430\u0442\u044C \u0437\u0430\u0434\u0443\u043C\u044B\u0432\u0430\u0442\u044C\u0441\u044F \u0438\u00A0\u0447\u0442\u043E-\u0442\u043E \u0432\u044B\u0431\u0438\u0440\u0430\u0442\u044C. \u0423\u00A0\u043C\u0435\u043D\u044F \u044D\u0442\u043E \u0432\u043E\u043E\u0431\u0449\u0435 \u043F\u043E\u043B\u0443\u0447\u0438\u043B\u043E\u0441\u044C \u0432\u00A0\u0442\u0440\u0438\u0434\u0446\u0430\u0442\u044C \u0442\u0440\u0438 \u0433\u043E\u0434\u0430\u00BB. \u041F\u0440\u0438\u0448\u043B\u043E\u0441\u044C \u0432\u043E\u0441\u043F\u043E\u043B\u043D\u044F\u0442\u044C \u043D\u0435\u0434\u043E\u0441\u0442\u0430\u044E\u0449\u0438\u0435 \u0437\u043D\u0430\u043D\u0438\u044F \u043F\u0430\u0440\u0430\u043B\u043B\u0435\u043B\u044C\u043D\u043E \u0441\u00A0\u0440\u0430\u0431\u043E\u0442\u043E\u0439. ");
