      i0.ɵɵtext(230, "\u0418\u0440\u0438\u043D\u0443 \u0422\u0438\u0442\u043A\u043E\u0432\u0443 \u0432\u0434\u043E\u0445\u043D\u043E\u0432\u043B\u044F\u0435\u0442 \u0436\u0438\u0437\u043D\u044C \u0421\u043E\u0444\u044C\u0438 \u041A\u043E\u0432\u0430\u043B\u0435\u0432\u0441\u043A\u043E\u0439, \u0434\u0435\u0432\u0438\u0437 \u043A\u043E\u0442\u043E\u0440\u043E\u0439 \u0431\u044B\u043B \u00AB\u0413\u043E\u0432\u043E\u0440\u0438 \u0447\u0442\u043E \u0437\u043D\u0430\u0435\u0448\u044C, \u0434\u0435\u043B\u0430\u0439 \u0447\u0442\u043E \u043E\u0431\u044F\u0437\u0430\u043D, \u0438\u00A0\u0431\u0443\u0434\u044C \u0447\u0442\u043E \u0431\u0443\u0434\u0435\u0442\u00BB. \u0418\u0440\u0438\u043D\u0430 \u0412\u0438\u043A\u0442\u043E\u0440\u043E\u0432\u043D\u0430 \u0434\u043E\u0431\u0430\u0432\u043B\u044F\u0435\u0442: \u00AB\u0421\u0435\u0439\u0447\u0430\u0441 \u044F\u00A0\u0441\u0447\u0438\u0442\u0430\u044E, \u0447\u0442\u043E \u201E\u0431\u0443\u0434\u044C \u0447\u0442\u043E \u0431\u0443\u0434\u0435\u0442\u201C \u043D\u0435\u043C\u043D\u043E\u0436\u043A\u043E \u043D\u0435\u00A0\u043C\u043E\u0451. \u041C\u044B\u00A0\u0441\u0430\u043C\u0438 \u0434\u0435\u043B\u0430\u0435\u043C \u0441\u0432\u043E\u0451 \u0431\u0443\u0434\u0443\u0449\u0435\u0435\u00BB. \u041B\u044E\u0434\u043C\u0438\u043B\u0443 \u041A\u043E\u043B\u0443\u043F\u0430\u0435\u0432\u0443 \u0432\u043E\u0441\u0445\u0438\u0449\u0430\u044E\u0442 \u0438\u0441\u0442\u043E\u0440\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043B\u0438\u0447\u043D\u043E\u0441\u0442\u0438: \u041C\u0430\u0440\u0438\u044F \u0421\u043A\u043B\u043E\u0434\u043E\u0432\u0441\u043A\u0430\u044F-\u041A\u044E\u0440\u0438, \u042D\u043C\u043C\u0438 \u041D\u0451\u0442\u0435\u0440, \u0418\u0440\u0435\u043D \u0416\u043E\u043B\u0438\u043E-\u041A\u044E\u0440\u0438; \u0430\u00A0\u0442\u0430\u043A\u0436\u0435 \u0436\u0435\u043D\u0449\u0438\u043D\u044B-\u043A\u043E\u043B\u043B\u0435\u0433\u0438 \u043F\u043E\u00A0\u043A\u043E\u043B\u043B\u0430\u0431\u043E\u0440\u0430\u0