        i0.ɵɵtext(145, "\u0421\u0435\u043C\u044C\u044F, \u043E\u0441\u043E\u0431\u0435\u043D\u043D\u043E \u0441\u00A0\u0434\u0435\u0442\u044C\u043C\u0438, \u043C\u043D\u043E\u0433\u0438\u043C \u043A\u0430\u0436\u0435\u0442\u0441\u044F \u043E\u0441\u043D\u043E\u0432\u043D\u043E\u0439 \u0442\u0440\u0443\u0434\u043D\u043E\u0441\u0442\u044C\u044E \u0434\u043B\u044F \u043F\u043E\u0441\u0442\u0440\u043E\u0435\u043D\u0438\u044F \u0443\u0441\u043F\u0435\u0448\u043D\u043E\u0439 \u043D\u0430\u0443\u0447\u043D\u043E\u0439 \u043A\u0430\u0440\u044C\u0435\u0440\u044B. \u0421\u0435\u043C\u044C\u044F \u0442\u0440\u0435\u0431\u0443\u0435\u0442 \u0432\u0440\u0435\u043C\u0435\u043D\u0438 \u0438\u00A0\u0441\u0438\u043B, \u0434\u0435\u0442\u0438 \u043C\u043E\u0433\u0443\u0442 \u0437\u0430\u0431\u043E\u043B\u0435\u0442\u044C, \u043A\u043E\u0433\u0434\u0430 \u043D\u0443\u0436\u043D\u043E \u0443\u0435\u0437\u0436\u0430\u0442\u044C \u0432\u00A0\u043A\u043E\u043C\u0430\u043D\u0434\u0438\u0440\u043E\u0432\u043A\u0443, \u0430\u00A0\u043E\u0442\u0447\u0435\u0442\u043D\u044B\u0439 \u043A\u043E\u043D\u0446\u0435\u0440\u0442 \u0445\u043E\u0440\u0430 \u043F\u0440\u0438\u0434\u0435\u0442\u0441\u044F \u043A\u0430\u043A \u0440\u0430\u0437 \u043D\u0430\u00A0\u0432\u0435\u0447\u0435\u0440\u043D\u0438\u0439 \u0441\u043E\u0437\u0432\u043E\u043D \u0441\u00A0\u0437\u0430\u0440\u0443\u0431\u0435\u0436\u043D\u044B\u043C\u0438 \u043A\u043E\u043B\u043B\u0435\u0433\u0430\u043C\u0438. \u041D\u0430\u0448\u0438 \u0433\u0435\u0440\u043E\u0438\u043D\u0438 \u043D\u0435\u00A0\u043E\u0442\u0440\u0438\u0446\u0430\u044E\u0442: \u0434\u0430, \u0441\u0435\u043C\u044C\u044F \u0438\u00A0\u043D\u0430\u0443\u043A\u0430\u00A0\u2014 \u044D\u0442\u043E \u0441\u043B\u043E\u0436\u043D\u043E. \u041A\u043E\u043C\u0443-\u0442\u043E \u043F\u0440\u0438\u0445\u043E\u0434\u0438\u043B\u043E\u0441\u044C \u0440\u0430\u0431\u043E\u0442\u0430\u0442\u044C \u0437\u0430\u00A0\u043A\u043E\u043C\u043F\u044C\u044E\u0442\u0435\u0440\u043E\u043C \u0441