        i0.ɵɵtext(169, "\u041A\u0430\u043A\u0438\u0435 \u0442\u0440\u0443\u0434\u043D\u043E\u0441\u0442\u0438 \u043C\u043E\u0433\u0443\u0442 \u0436\u0434\u0430\u0442\u044C \u0443\u0447\u0435\u043D\u044B\u0445 \u0432\u00A0\u043D\u0430\u0443\u0447\u043D\u043E\u0439 \u043A\u0430\u0440\u044C\u0435\u0440\u0435? \u0415\u0441\u0442\u044C\u00A0\u043B\u0438 \u043A\u0430\u043A\u0438\u0435-\u0442\u043E \u043E\u0441\u043E\u0431\u044B\u0435 \u0441\u043B\u043E\u0436\u043D\u043E\u0441\u0442\u0438 \u0432\u00A0\u0440\u0430\u0431\u043E\u0442\u0435 \u0436\u0435\u043D\u0449\u0438\u043D-\u0443\u0447\u0435\u043D\u044B\u0445? \u041F\u043E\u0447\u0435\u043C\u0443 \u0432\u00A0\u0435\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0445 \u043D\u0430\u0443\u043A\u0430\u0445 \u0434\u043E\u043B\u044F \u0436\u0435\u043D\u0449\u0438\u043D \u0447\u0443\u0442\u044C \u0431\u043E\u043B\u044C\u0448\u0435\u00A020%? ");
